import { OnDestroy, OnInit } from '@angular/core';
import { Component, EventEmitter, Input, Output } from '@angular/core';
import { Currency } from '../../../interfaces/currency.model';
import { Store } from '@ngrx/store';
import { Subscription } from 'rxjs';
import { selectPortfolio } from '../../../state/currencies.selectors';

@Component({
  selector: 'home-crypto-selector',
  templateUrl: './crypto-selector.component.html'
})
export class CryptoSelectorComponent implements OnDestroy, OnInit {
  @Input() currencies: ReadonlyArray<Currency> = [];
  @Output() add = new EventEmitter<Currency>();

  currencyPortfolio$ = this.store.select(selectPortfolio);

  subscriptions: Subscription[] = [];
  selectedCryptosSubscription: Subscription = new Subscription;

  cryptoIdsInPortfolio: string[] = []

  text: any = "";
  results: Currency[] = [];

  constructor(private store: Store) {}

  ngOnInit() {
    this.selectedCryptosSubscription = this.currencyPortfolio$.subscribe(cc => {
      this.cryptoIdsInPortfolio = cc.map(c => c.id)
    })

    this.subscriptions.push(this.selectedCryptosSubscription);
  }

  ngOnDestroy() {
    this.subscriptions.forEach(sub => sub.unsubscribe());
  }

  search(event: any) {
    const searchTerm = event.query.trim().toLowerCase()

    // NOTE: Could filter off more fields with "keys", but id, name and symbol more or less cover it
    this.results = this.currencies.filter(c => {
      return (
        (
          c.id.toLowerCase().indexOf(searchTerm) > -1 || c.name.toLowerCase().indexOf(searchTerm) > -1 || c.symbol.toLowerCase().indexOf(searchTerm) > -1) &&
          this.cryptoIdsInPortfolio.indexOf(c.id) === -1
        )
    })
  }

  addCurrency(e: Currency) {
    this.text = ""
    this.add.emit(e)
  }
}

import { Component, OnDestroy, OnInit } from '@angular/core';
import { Subscription } from 'rxjs';
import { FilesService } from '../../services/files/files.service';
import { File, FileStatus } from '../../interfaces/file';
import { MultiCheckboxState } from '../../components/checkbox/checkbox.model';

@Component({
  selector: 'page-downloads',
  templateUrl: './files.component.html',
  styleUrls: ['./files.component.scss']
})
export class FilesComponent implements OnDestroy, OnInit {
  subscriptions: Subscription[] = [];
  fileSubscription: Subscription = new Subscription;

  filesService: FilesService;
  files: File[] = [];
  selectedFiles: File[] = [];
  showModal = false;

  constructor(filesService: FilesService) {
    this.filesService = filesService;
  }

  ngOnInit(): void {
    this.fileSubscription = this.filesService.getFiles().subscribe(response => {
      this.files = response;
    })

    this.subscriptions.push(this.fileSubscription);
  }

  ngOnDestroy(): void {
    this.subscriptions.forEach(sub => sub.unsubscribe());
  }

  /**
   * Fires when multistatte checkbox is clicked
   *
   * @returns {void}
   * @memberof FilesComponent
   */
  handleSelectionClick(e: MultiCheckboxState): void {
    if (e === MultiCheckboxState.Empty || e === MultiCheckboxState.Partial) {
      this.selectedFiles = this.files;
    } else {
      this.selectedFiles = [];
    }
  }

  /**
   * Fires when clicking to display the modal dialog
   *
   * @returns {void}
   * @memberof FilesComponent
   */
  handleDialogDisplay(display: boolean): void {
    this.showModal = display;
  }

  /**
   * The row selection state of the table
   *
   * @returns {MultiCheckboxState}
   * @memberof FilesComponent
   */
  get tableState(): MultiCheckboxState {
    if (this.selectedFiles.length === 0) {
      return MultiCheckboxState.Empty;
    }

    if (this.selectedFiles.length === this.files.length) {
      return MultiCheckboxState.Full;
    }

    return MultiCheckboxState.Partial;
  }

  /**
   * The number of files currently selected
   *
   * @returns {number}
   * @memberof FilesComponent
   */
  get selectedFileCount(): number {
    return this.selectedFiles.length;
  }

  /**
   * The number of files currently selected that are not available
   *
   * @returns {number}
   * @memberof FilesComponent
   */
   get selectedUnavailableFileCount(): number {
    return this.selectedFiles.filter(f => f.status !== FileStatus.Available).length;
  }
}

